var eventoService={add:function(e,t){try{connector.post(url.evento.add,JSON.stringify(e),function(e){null!=e?(successMessage({title:message.evento.add.title,content:message.evento.add.success}),t(e)):errorMessage({title:message.evento.add.title,content:message.evento.add.error})})}catch(e){console.log(e)}},update:function(e,t){try{connector.post(url.evento.update,JSON.stringify(e),function(e){null!=e&&0!==e?(successMessage({title:message.evento.update.title,content:message.evento.update.success}),t(e)):errorMessage({title:message.evento.update.title,content:message.evento.update.error})})}catch(e){console.log(e)}},remove:function(e,t){try{connector.post(url.evento.delete,JSON.stringify(e),function(e){null!=e&&0!==e?(successMessage({title:message.evento.delete.title,content:message.evento.delete.success}),t(e)):errorMessage({title:message.evento.delete.title,content:message.evento.delete.error})})}catch(e){console.log(e)}},get:function(e,t){try{connector.post(url.evento.get,JSON.stringify(e),function(e){null!=e?t(e):errorMessage({title:message.evento.get.title,content:message.evento.get.error})})}catch(e){console.log(e)}},list:function(e,t){try{connector.post(url.evento.list,JSON.stringify(e),function(e){null!=e&&0<e.length?t(e):(t(e),infoMessage({title:message.evento.list.title,content:message.evento.list.empty}))})}catch(e){console.log(e)}},checkAsistenciaEscuela:function(e,t){try{connector.post(url.evento.checkEscuela,JSON.stringify(e),function(e){null!=e?t(e):errorMessage({title:message.evento.get.title,content:message.evento.get.error})})}catch(e){console.log(e)}},checkAsistenciaGrupo:function(e,t){try{connector.post(url.evento.checkGrupo,JSON.stringify(e),function(e){null!=e?t(e):errorMessage({title:message.evento.get.title,content:message.evento.get.error})})}catch(e){console.log(e)}}};